import axios from 'axios';

class ArticleService {
    static getHeaders() {
        return axios.get('http://localhost:5098/GetHeaders')
            .then(response => response.data)
            .catch(error => {
                console.error(error);
                throw error;
            });
    }
}

export default ArticleService;
